import React from "react";
import { Routes, Route } from "react-router"
import Auth from "./components/Auth.js"
import Profile from "./components/Profile.js"

export default function App() {
    return (
        <div>
            <Routes>
                <Route
                    exact path="/"
                    render={() => <Auth />}
                />
                <Route
                    exact path="/profile"
                    render={() => <Profile />}
                />
            </Routes>

        </div>
    )
}
